const checkDangerLevel = (e,type,ret) => {
  if(type === "water_level"){
      if(e >= 1900){
          if(ret === "prog"){
              return "danger"
          }
          else if(ret === "back"){
              return { backgroundColor: "#8F0031" };
          }
          else if(ret === "text"){
              return "SEVERE"
          }
      }
  }
}

export default checkDangerLevel
